Lockets can be registered by making a PUT request to /api/v2/lockets. This expects the config value for locket.token to be present in the Authorization header. Request It expects an application/json body: { "port": 8080, "host": "some.locket.com"
} port Required. This is the TCP port that the Locket server is listening on. host Defaults to the request IP. If provided, this should be a domain that points to the request IP. If there was an error looking up the domain, errorDomainFailedLookup will be thrown. If the lookup succeeded but the resulting IPs didn't include the request IP, errorDomainDidntMatch will be thrown. Response You'll receive an application/json response. Its data will be a locketInterface object: { "port": 8080, "host": "some.optional.locket.com"
} Errors errorDomainFailedLookup and errorDomainDidntMatch are assigned to this endpoint. See the body section for when it'll be thrown.
